a:260:{i:0;a:1:{s:2:"id";s:19:"2390936041313126837";}i:1;a:1:{s:10:"short_code";s:11:"CEuT6lvJcm1";}i:2;a:1:{s:12:"created_time";i:1599241808;}i:3;a:1:{s:7:"caption";s:2109:"How was your week??? 
I started out my week with a 9 mile hike in upstate NY to clear my head and put life into perspective. I needed to find a little clarity in my busy mind, and hiking in the mountains is always the best solution for me. This is a hectic and weird time in all of our lives. For parents, the new school year is starting (ish) with our kids wearing masks, teachers wearing plastic shields, and laptops being substituted every other day for classrooms. 
Travel is still on hold for most of the world and who knows when it will resume. Fashion is still alive but people aren’t quite sure what they will need going forward, where they will be wearing their things, and after so much time in quarantine what will still fit? (I can help you with this) 😉
Thanks to online fitness experts @pulsebyjulied @barmethodroslyn @jesskingnyc @fitnessbytomas @isaacboots and 🥾hiking upstate,  I didn’t completely lose my mind during the past 6 months. Grateful for all of you unbelievably motivated souls for keeping us “off of the couch” and in our jeans! 
It’s important sometimes to take your own “time out” to think about what’s going on in your life, and how you want to face the challenges that lie ahead. 
I made a mental game plan of things that I want to accomplish and pursue. Now I need to move forward and execute them. You all know I’m a realist, and like many I am a procrastinator unless given a deadline. 
So here’s wishing everyone a wonderful fall 🍁season! Let’s use our time wisely to fill ourselves with things that are gratifying. I’m excited to get back to writing about Cuban style and styling both new & established clients. Let’s have the strength to let go of the things that weigh us down so we can fly. See ya on a trail ⛰
XxE 
